import {useState} from 'react';

function Mid2() {
    let [name,SetName] = useState(0);
    
    function nameChange(){
        SetName(name=name+1);
    }
    function nameSub(){
        SetName(name=name-1)
    }
    return ( 
        <div>
        <p>{name}</p>
        <button className='btn btn-primary' onClick={nameChange}>+</button>
        <button className='btn btn-primary' onClick={nameSub}>+</button>
        </div>
     );
}

export default Mid2;
